CREATE TABLE MAT_HANG
(
   MAMH VARCHAR(30) NOT NULL PRIMARY KEY,
   TENMH NVARCHAR(300),
   PICTURE NVARCHAR(MAX), -- Lữu trữ đường dẫn file.
   DONVITINH NVARCHAR(30),
   SO_GAM DECIMAL(18,5), -- Giá trị này chỉ set khi IsProductKilogram = true (sản phẩm tính theo kg). Số gam VD: Ba củ cà rốt 200g, Giá 1KG = 50.000
   IsProductKilogram VARCHAR(10), -- Lưu trữ true và false: true là sản phẩm tính theo Giá trên 1KG, false là sản phẩm không theo Giá trên 1KG.
   MOTA_SANPHAM NVARCHAR(MAX),
   GIA_BAN MONEY, -- Giá bán trên 1 mặt hàng hoặc giá bán trên 1 KG.
   SO_LUONG_TON_HIENTAI DECIMAL(18,5) DEFAULT 0 CHECK (SO_LUONG_TON_HIENTAI >= 0),  -- Lưu trữ thông tin hàng tồn của mỗi sản phẩm, khi nhập hàng và khi bán hàng còn lại bao nhiêu, được cài bằng trigger trong bảng CHITIET_HOADON  và  CHITIET_PHIEU_NHAPHANG.
   MALOAI VARCHAR(30),
   MA_BRAND VARCHAR(30),
   CONSTRAINT FK_MATHANG_LOAI_MATHANG
        FOREIGN KEY (MALOAI)
        REFERENCES dbo.LOAI_MATHANG (MALOAI),
   CONSTRAINT FK_MATHANG_BRAND
        FOREIGN KEY (MA_BRAND)
        REFERENCES dbo.BRAND (MA_BRAND)
);


