CREATE TABLE CHITIET_PHIEU_NHAPHANG
(
   ID_PHIEUNHAP VARCHAR(30) NOT NULL,
   MAMH VARCHAR(30) NOT NULL,
   SOLUONG DECIMAL(18,5) CHECK (SOLUONG >= 0), -- Số lượng nhập cho sản phẩm tính theo đơn vị số nguyên và tính theo đơn vị số thực VD: 0.5 KG khoai lang, 1 Chai tương ớt. (Có sản phẩm tính theo KG).
   GIA_NHAP MONEY CHECK (GIA_NHAP >= 0),
   HSD DATE,
   NSX DATE,
   TONGTIEN MONEY, -- Cột này không nhập, được tính bằng trigger.
   CONSTRAINT PK_CHITIETPHIEUNHAPHANG
        PRIMARY KEY (
                        ID_PHIEUNHAP,
                        MAMH
                    ),
   CONSTRAINT FK_CHITIETPHIEUNHAPHANG_MATHANG
        FOREIGN KEY (MAMH)
        REFERENCES dbo.MAT_HANG (MAMH),
   CONSTRAINT FK_CHITIETPHIEUNHAPHANG_PHIEUNHAPHANG
        FOREIGN KEY (ID_PHIEUNHAP)
        REFERENCES dbo.PHIEU_NHAPHANG (ID_PHIEUNHAP)
);


-- Bảng CHITIET_PHIEU_NHAPHANG cài đặt trigger Thêm - xóa - sửa sẽ tự động tính cột thành tiền TONGTIEN MONEY.
-- Bảng CHITIET_PHIEU_NHAPHANG cài đặt trigger Thêm - xóa - sửa sẽ tự động tính cột thành tiền TONGTIEN_PHIEUNHAP MONEY cho bảng PHIEU_NHAPHANG.
GO
CREATE TRIGGER TRIGGER_TINH_TONGTIEN_AND_TINH_TONGTIEN
ON CHITIET_PHIEU_NHAPHANG
AFTER INSERT, UPDATE, DELETE
AS
BEGIN
    SET NOCOUNT ON;

    -- Tính lại tổng tiền cho các bản ghi bị ảnh hưởng bởi thay đổi
    UPDATE C
    SET TONGTIEN = ISNULL(C.SOLUONG * C.GIA_NHAP, 0)
    FROM CHITIET_PHIEU_NHAPHANG C
    INNER JOIN inserted I ON C.ID_PHIEUNHAP = I.ID_PHIEUNHAP
    WHERE I.ID_PHIEUNHAP IS NOT NULL;

    -- Tính lại tổng tiền cho các bản ghi bị ảnh hưởng bởi thay đổi hoặc xóa
    UPDATE C
    SET TONGTIEN = ISNULL(C.SOLUONG * C.GIA_NHAP, 0)
    FROM CHITIET_PHIEU_NHAPHANG C
    INNER JOIN deleted D ON C.ID_PHIEUNHAP = D.ID_PHIEUNHAP
    WHERE D.ID_PHIEUNHAP IS NOT NULL;

    -- Cập nhật cột TONGTIEN_PHIEUNHAP trong bảng PHIEU_NHAPHANG
    UPDATE P
    SET TONGTIEN_PHIEUNHAP = (
        SELECT SUM(TONGTIEN)
        FROM CHITIET_PHIEU_NHAPHANG
        WHERE ID_PHIEUNHAP = P.ID_PHIEUNHAP
    )
    FROM PHIEU_NHAPHANG P
    INNER JOIN inserted I ON P.ID_PHIEUNHAP = I.ID_PHIEUNHAP
    WHERE I.ID_PHIEUNHAP IS NOT NULL;

	-- Cập nhật cột TONGTIEN_PHIEUNHAP trong bảng PHIEU_NHAPHANG khi có bản ghi bị xóa
    UPDATE P
    SET TONGTIEN_PHIEUNHAP = (
        SELECT SUM(TONGTIEN)
        FROM CHITIET_PHIEU_NHAPHANG
        WHERE ID_PHIEUNHAP = P.ID_PHIEUNHAP
    )
    FROM PHIEU_NHAPHANG P
    INNER JOIN (
        SELECT DISTINCT ID_PHIEUNHAP
        FROM deleted
    ) AS D ON P.ID_PHIEUNHAP = D.ID_PHIEUNHAP
    WHERE D.ID_PHIEUNHAP IS NOT NULL;

END;
GO



-- Bảng CHITIET_PHIEU_NHAPHANG cài đặt trigger Thêm - xóa - sửa sẽ tự động cập nhật cột SO_LUONG_TON_HIENTAI INT trong bảng MAT_HANG.
GO
CREATE TRIGGER TRIGGER_UPDATE_SO_LUONG_TON_HIENTAI_CHITIET_PHIEU_NHAPHANG
ON CHITIET_PHIEU_NHAPHANG
AFTER INSERT, UPDATE, DELETE
AS
BEGIN
    SET NOCOUNT ON;

    -- Cập nhật số lượng tồn hiện tại của mỗi mặt hàng sau mỗi thao tác
    UPDATE M
    SET SO_LUONG_TON_HIENTAI = ISNULL(M.SO_LUONG_TON_HIENTAI, 0) + ISNULL(I.SOLUONG, 0) - ISNULL(D.SOLUONG, 0)
    FROM MAT_HANG M
    LEFT JOIN (SELECT ID_PHIEUNHAP, MAMH, SUM(SOLUONG) AS SOLUONG FROM inserted GROUP BY ID_PHIEUNHAP, MAMH) I
    ON M.MAMH = I.MAMH
    LEFT JOIN (SELECT ID_PHIEUNHAP, MAMH, SUM(SOLUONG) AS SOLUONG FROM deleted GROUP BY ID_PHIEUNHAP, MAMH) D
    ON M.MAMH = D.MAMH;

END;
GO



