-- Bảng CHITIET_HOADON cài đặt trigger Thêm - xóa - sửa sẽ tự động tính cột tổng tiền TONGTIEN_HD MONEY trong bảng HOADON.

GO
CREATE TRIGGER TRIGGER_TINH_THANH_TIEN_AND_TONG_THANH_TIEN
ON CHITIET_HOADON
AFTER INSERT, UPDATE, DELETE
AS
BEGIN
    SET NOCOUNT ON;

    -- Tính lại thành tiền cho các bản ghi bị ảnh hưởng bởi thay đổi
    UPDATE C
    SET THANH_TIEN = ISNULL(C.SOLUONG * M.GIA_BAN, 0)
    FROM CHITIET_HOADON C
    INNER JOIN inserted I ON C.ID_HOADON = I.ID_HOADON AND C.MAMH = I.MAMH
    INNER JOIN MAT_HANG M ON C.MAMH = M.MAMH
    WHERE I.ID_HOADON IS NOT NULL;

    -- Tính lại thành tiền cho các bản ghi bị ảnh hưởng bởi thay đổi hoặc xóa
    UPDATE C
    SET THANH_TIEN = ISNULL(C.SOLUONG * M.GIA_BAN, 0)
    FROM CHITIET_HOADON C
    INNER JOIN deleted D ON C.ID_HOADON = D.ID_HOADON AND C.MAMH = D.MAMH
    INNER JOIN MAT_HANG M ON C.MAMH = M.MAMH
    WHERE D.ID_HOADON IS NOT NULL;

    -- Cập nhật tổng tiền của hóa đơn khi có thêm hoặc sửa đổi
    UPDATE H
    SET TONGTIEN_HD = (
        SELECT SUM(ISNULL(CH.THANH_TIEN, 0))
        FROM CHITIET_HOADON CH
        WHERE CH.ID_HOADON = H.ID_HOADON
    )
    FROM HOADON H
    INNER JOIN inserted I ON H.ID_HOADON = I.ID_HOADON
    WHERE I.ID_HOADON IS NOT NULL;

    -- Cập nhật tổng tiền của hóa đơn khi có bản ghi bị xóa
    UPDATE H
    SET TONGTIEN_HD = (
        SELECT SUM(ISNULL(CH.THANH_TIEN, 0))
        FROM CHITIET_HOADON CH
        WHERE CH.ID_HOADON = H.ID_HOADON
    )
    FROM HOADON H
    INNER JOIN deleted D ON H.ID_HOADON = D.ID_HOADON
    WHERE D.ID_HOADON IS NOT NULL;
END;
GO



-- Bảng CHITIET_HOADON cài đặt trigger Thêm - xóa - sửa sẽ tự động cập nhật cột SO_LUONG_TON_HIENTAI INT trong bảng MAT_HANG.
GO
CREATE TRIGGER TRIGGER_UPDATE_SO_LUONG_TON_HIENTAI_CHITIET_HOADON
ON CHITIET_HOADON
AFTER INSERT, UPDATE, DELETE
AS
BEGIN
    SET NOCOUNT ON;

    -- Cập nhật số lượng tồn hiện tại của mỗi mặt hàng sau mỗi thao tác
    UPDATE M
    SET SO_LUONG_TON_HIENTAI = (ISNULL(M.SO_LUONG_TON_HIENTAI, 0) - ISNULL(I.SOLUONG, 0)) + ISNULL(D.SOLUONG, 0)
    FROM MAT_HANG M
    LEFT JOIN (SELECT ID_HOADON, MAMH, SUM(SOLUONG) AS SOLUONG FROM inserted GROUP BY ID_HOADON, MAMH) I
    ON M.MAMH = I.MAMH
    LEFT JOIN (SELECT ID_HOADON, MAMH, SUM(SOLUONG) AS SOLUONG FROM deleted GROUP BY ID_HOADON, MAMH) D
    ON M.MAMH = D.MAMH;

END;
GO
